import React from "react";
import './PinButtonCss.css';

class PinButton extends React.Component{
    constructor(props){
        super(props);
        this.state= {
            classe: "btn btn-primary pin"
        }
    }
    render(){
        return(
            <button 
                type="button" 
                className="btn btn-primary pin">
                    {this.props.partyName}
            </button>
        );
    }
}

export default PinButton;
